import React, { Component } from 'react';
import styles from './Logo.module.css'; 

class Logo extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() {
        const size = this.props.size;
        return ( 
            <>
                <img src="/images/owleague-square.png" className={`${styles.logo} ${styles[size]}`} alt=""/>
            </>
         );
    }
}
 
export default Logo;
